import React from "react";
import "./Home.css";
import logo from './logo.png';
import meal from './meal.png';

function Home() {
    return (
        <div className="image">
            <img className="logo" src={logo} alt="logo" height="160px" width="400" align="left" margin-top="0"></img>
        </div>
    );
}
